CREATE DEFINER=`root`@`localhost` PROCEDURE `ListaRutas`(in id_Sistema char(32), in id_Central char(32))
BEGIN
	select IdRuta as IdRuta,Tipo as Tipo from Rutas 
		where IdSistema=id_Sistema AND
				Central=id_Central
