CREATE DEFINER=`root`@`localhost` PROCEDURE `TeclasOcupadasSectores`(in id_sistema char(32))
BEGIN
	SELECT posHMI, IdSector, 'externo' AS destino FROM new_cd40_trans.destinosexternossector
         WHERE IdSistema=id_sistema
	UNION
